import React from "react";
import Search from "./Search";
const Banner = () => {
  return (
    <>
      <div className="bg-brandColor container sm:max-w-md md:max-w-4xl text-center relative -mt-8 sm:mt-16">
        <h1 className="text-white text-3xl sm:text-4xl font-normal leading-tight mb-8 sm:mb-0">
          Free Google Slides and PowerPoint templates to boost your
          presentations
        </h1>
        <Search />
      </div>
    </>
  );
};

export default Banner;
